import React, { Component } from "react";

class Home extends Component {
  apiEndPoint = "http://localhost:5000/api/videos";

  render() {
    return <div>Home</div>;
  }

  componentDidMount() {
    // Send a POST request
    axios
      .get(this.apiEndPoint)
      .then(function(response) {
        // handle success
        console.log(response);

        // Reset the form
        document.getElementById("uploadForm").reset();
      })
      .catch(function(error) {
        // handle error
        console.log(error);
      });
  }
}

export default Home;
